import React from 'react';
import '../components/ProjectCard.css';
import Rose from '../components/rose.jpg';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

// React component for the frontside of the card
class ProjectCard extends React.Component {
  render() {
   return(
     <React.Fragment>
<Container className="projectContainer">
<Row>
<Col className="projectCol" lg={12}>
            <div className="card">
                <div className="card-horizontal">
                    <div className="img-square-wrapper">
                        <img className="projectImage" src={Rose} alt="Card image cap"/>
                    </div>
                    <div className="card-body">
                        <h4 className="card-title">YelpCamp React Project</h4>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                </div>

            </div>

        </Col>
    </Row>

</Container>
<Container className="projectContainer">
<Row>
<Col className="projectCol" lg={12}>
            <div className="card">
                <div className="card-horizontal">
                    <div className="img-square-wrapper">
                        <img className="projectImage" src={Rose} alt="Card image cap"/>
                    </div>
                    <div className="card-body">
                        <h4 className="card-title">YelpCamp React Project</h4>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                </div>

            </div>

        </Col>
    </Row>

</Container>

  </React.Fragment>  

    );
  }
 }

 export default ProjectCard;
